import logo from './logo.svg';
import './App.css';
import { ChatBot } from 'aws-amplify-react';
import Chat from './chatbot';




function App() {

  const get = () => {request('http://stackabuse.com', function(err, res, body) {  
    console.log(body);
});}

  return (
    <div className="App">
      <button onSubmit={get()}>CLick</button>
      <Chat />
    </div>
  );
}

export default App;
